import React from "react";

export const ContactPicker = ({contacts, onChange}) => {
  return (
		<select onChange={onChange}>
      <option value="" key="0" selected></option>
      {
        contacts.map((contact, index) => {
          <option key={index + 1}>{contact.name}</option>
        })
      }
		</select>
	);
};
